import React from 'react';
import {NavLink} from "react-router-dom";

const NavBar = () => {
    return (
        <div>
            <nav className="navbar navbar-dark bg-primary">
                <NavLink className="navbar-brand fontify" to="#">MgoStream</NavLink>
                    <ul className="navbar-nav mr-auto">
                        <li className="nav-item d-inline">
                            <NavLink className="nav-link fontify" to="#">Home <span className="sr-only">(current)</span></NavLink>
                        </li>
                        <li className="nav-item d-inline">
                            <NavLink className="nav-link fontify" to="#">Features</NavLink>
                        </li>
                    </ul>
            </nav>

        </div>
    );
};

export default NavBar;
